import { useState } from "react"
import "./slaider.css"
import my_photo from "./photo1.jpg"

export const Slaider = () => {
  const photo_qty = 9
  const photos = []
  for (let i = 1; i <= photo_qty; i++) {
    photos.push(`photo_${i}`)
  }
  const [photo, setNumberPhoto] = useState(photos[0])

  function bgImage(props) {
    const imageUrl = require(`./images/${props.imageName}.jpg`)
    return <div style={{ backgroundImage: `url(${imageUrl})` }} />
  }

  return (
    <section className="main">
      <div className="photos">
        {photos.map((photo_num, number) => {
          return (
            <div
              className={`${photo_num} photo`}
              key={number}
              style={{ backgroundImage: "url(/photo1.jpg)" }}
            ></div>
          )
        })}
      </div>
    </section>
  )
}
